import React, { Component } from 'react';
import fire from '../../config/base';
import "../../App.css";


class Header extends Component {
    constructor(props) {
        super(props);
        this.logout = this.logout.bind(this);
    }
    logout() {
        console.log("logging out");
        fire.auth().signOut();
    }
    render() {
        return (
            <nav class="navbar navbar-expand-lg navbar-light bg-light mb-4">
                <a class="navbar-brand" href="#">MuTime</a>
                <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>

                <div class="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul class="navbar-nav mr-auto">
                        <li class="nav-item active">
                            <a class="nav-link" href="#">Accueil <span class="sr-only">(current)</span></a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link disabled" href="#" tabIndex="-1" aria-disabled="true">Favoris</a>
                        </li>
                    </ul>
                </div>
                <div id="divLogout">
                    
                    <a class="nav-link active" id="btnLogout" onClick={this.logout} href="#" aria-disabled="true">
                        <i class="fas fa-sign-out-alt"></i>
                        Logout
                    </a>
                    
                </div>
            </nav>
        )
    }   
}

export default Header;
